Description:
A Mercafacil foi feita para fazer a diferença na transformação do varejo.

Temos certeza que podemos fazer isso quando tornamos possível entender as individualidades de cada um que estão no comportamento de compra e traduzir isso em conversão de vendas para o varejista. 

Vamos muito além de sistemas, somos uma empresa feita por pessoas e para pessoas, que utiliza a tecnologia como um meio de sempre melhorar a experiência de consumo e diariamente aperfeiçoar o varejo de maneira criativa e funcional.

Compreender pessoas é uma arte, e essa é a nossa especialidade!

Não somos CRM, nem consultoria, nem clube de fidelidade. Somos CBM (Consumer Behavior Management)! Nossa plataforma de compreensão de consumo utiliza tecnologias de big data, data mining e geolocalização para fornecer informações estratégicas que vão tornar a sua tomada de decisão mais efetiva e a sua relação com quem compra de você ainda mais próxima.

Nós queremos fazer a diferença no varejo, queremos fazer a diferença para nossos clientes e temos certeza que juntos vamos conseguir.
____

Nossos Valores:

- A partir das pessoas;
- Transparência em tudo;
- Impulsionados pela criatividade;
- Ser sempre melhor que ontem;
- Obcecados pelo WOW;
- Inteligência inspiradora;
- Criadores de experiências positivas.

#vempramercafacil
____

We study retail data to increase their profit by providing strategic indicators.

We created this solution because of the difficulty that retailers have to manage your business taking decisions based on strategic information supported by facts and data.
